import {FirstName} from "./App";

const ComC = () =>{
    return( 
    <>
        <FirstName.Consumer> 
            {(fname)=>{
                return <h1> My name is {fname} </h1>;
            }} 
        </FirstName.Consumer>  
        
    </>);
};

export default ComC;
